import React from 'react';
import { View, Tabbar, TabbarItem, Epic } from '@vkontakte/vkui/dist/components';
import Panel from '@vkontakte/vkui/dist/components/Panel/Panel';
import PanelHeader from '@vkontakte/vkui/dist/components/PanelHeader/PanelHeader';
import Button from '@vkontakte/vkui/dist/components/Button/Button';
import Div from '@vkontakte/vkui/dist/components/Div/Div';

const home = props => (
    <Panel id={props.id}> 
    {console.log(props)}
        <PanelHeader>
            Главная
        </PanelHeader>
            <img style={{height: "50%", width: "50%", marginLeft: "25%"}} alt="" src="https://vk.com/sticker/1-16271-256"/>
        <Div>
            <Button onClick={() => props.goToPage("second")} size="xl" mode="secondary">Перейти на вторую панель</Button>
        </Div>
    </Panel>
);
class tabbar extends React.Component {
    constructor (props) {
      super(props);
  
      this.state = {
        activeStory: 'more'
      };
      this.onStoryChange = this.onStoryChange.bind(this);
    }
  
    onStoryChange (e) {
      this.setState({ activeStory: e.currentTarget.dataset.story })
    }
  
    render () {
  
      return (
        <Epic activeStory={this.state.activeStory} tabbar={
          <Tabbar>
            <TabbarItem
              onClick={this.onStoryChange}
              selected={this.state.activeStory === 'feed'}
              data-story="feed"
              text="Новости"
            ><Icon28NewsfeedOutline /></TabbarItem>
            <TabbarItem
              onClick={this.onStoryChange}
              selected={this.state.activeStory === 'discover'}
              data-story="discover"
              text="Поиск"
            ><Icon28SearchOutline /></TabbarItem>
            <TabbarItem
              onClick={this.onStoryChange}
              selected={this.state.activeStory === 'messages'}
              data-story="messages"
              label="12"
              text="Сообщения"
            ><Icon28MessageOutline /></TabbarItem>
            <TabbarItem
              onClick={this.onStoryChange}
              selected={this.state.activeStory === 'notifications'}
              data-story="notifications"
              text="Уведомлен."
            ><Icon28Notifications /></TabbarItem>
            <TabbarItem
              onClick={this.onStoryChange}
              selected={this.state.activeStory === 'more'}
              data-story="more"
              text="Ещё"
            ><Icon28More /></TabbarItem>
          </Tabbar>
        }>
          <View id="feed" activePanel="feed">
            <Panel id="feed">
              <PanelHeader>Новости</PanelHeader>
            </Panel>
          </View>
          <View id="discover" activePanel="discover">
            <Panel id="discover">
              <PanelHeader>Поиск</PanelHeader>
            </Panel>
          </View>
          <View id="messages" activePanel="messages">
            <Panel id="messages">
              <PanelHeader>Сообщения</PanelHeader>
            </Panel>
          </View>
          <View id="notifications" activePanel="notifications">
            <Panel id="notifications">
              <PanelHeader>Уведомления</PanelHeader>
            </Panel>
          </View>
          <View id="more" activePanel="more">
            <Panel id="more">
              <PanelHeader>Ещё</PanelHeader>
            </Panel>
          </View>
        </Epic>
      )
    }
  }

export default home;
